import React from 'react'

import '../propertycard/Propertycard.css'
import  {datas} from '../../Data/data';

const Propertycard = () => {
    const cards = datas.map(
        (ele)=> <div className='each-card'>
            <p>Price:</p>
            <p>{ele.price}</p>
            <p>bhk:</p>
            <p>{ele.Bhk}</p>
            <p>Bathrooms:</p>
            <p>{ele.price}</p>
            <p>Price:</p>
            <p>{ele.price}</p>
        </div>
    );

  return (
    <div className='cards'>
      <p>{datas[0].price}</p>
    </div>
  )
}

export default Propertycard
